import React, { Component } from 'react';

class CourseItem extends Component {
    render() {
        return (

            

            <div className="form-check">
            <input onClick={this.props.selectCourse} 
            className="form-check-input" type="radio" 
            name="course-radio" id="radio" value={this.props.course}/>
            <label class="form-check-label" for="radio">{this.props.name}</label>
           </div> 
        );
    }
}

export default CourseItem;
